le=\"\u041f\u0435\u0442\u0440\u043e\u043f\u0430\u0432\u043b\u043e\u0432\u0441\u043a\u0438\u0439 \u0441\u043e\u0431\u043e\u0440\">\u041f\u0435\u0442\u0440\u043e\u043f\u0430\u0432\u043b\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u0441\u043e\u0431\u043e\u0440\u0430<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u0431\u044b\u043b\u0438 \u0442\u043e\u0440\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e \u043f\u0435\u0440\u0435\u0437\u0430\u0445\u043e\u0440\u043e\u043d\u0435\u043d\u044b \u043e\u0441\u0442\u0430\u043d\u043a\u0438 \u0432\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043a\u043d\u044f\u0437\u044f \u041a\u0438\u0440\u0438\u043b\u043b\u0430 \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u043e\u0432\u0438\u0447\u0430 \u0438 \u0435\u0433\u043e \u0436\u0435\u043d\u044b \u0412\u0438\u043a\u0442\u043e\u0440\u0438\u0438 \u0424\u0451\u0434\u043e\u0440\u043e\u0432\u043d\u044b, \u0443\u043c\u0435\u0440\u0448\u0438\u0445 \u0432\u043e \u0424\u0440\u0430\u043d\u0446\u0438\u0438 \u0432 \u043a\u043e\u043d\u0446\u0435 30-\u0445 \u0433\u043e\u0434\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1997\" class=\"mw-redirect\" title=\"1997\">1997<\/a>&#160;\u2014 \u0436\u0443\u0440\u043d\u0430\u043b \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Nature\" title=\"Nature\">Nature<\/a>\u00bb \u0441\u043e\u043e\u0431\u0449\u0438\u043b, \u0447\u0442\u043e \u0443\u0447\u0451\u043d\u044b\u0435 \u0438\u0437 \u0420\u043e\u0441\u043b\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%B4%D0%B8%D0%BD%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u042d\u0434\u0438\u043d\u0431\u0443\u0440\u0433\">\u042d\u0434\u0438\u043d\u0431\u0443\u0440\u0433\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%BE%D1%82%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u044f\">\u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u044f<\/a>) \u0432\u043e\u0441\u043f\u0440\u043e\u0438\u0437\u0432\u0435\u043b\u0438 \u044f\u0433\u043d\u0451\u043d\u043a\u0430 \u0431\u0435\u0437 \u0443\u0447\u0430\u0441\u0442\u0438\u044f \u043f\u043e\u043b\u043e\u0432\u044b\u0445 \u043a\u043b\u0435\u0442\u043e\u043a \u0431\u0430\u0440\u0430\u043d\u0430. \u041d\u0430 \u0441\u0432\u0435\u0442 \u043f\u043e\u044f\u0432\u0438\u043b\u0430\u0441\u044c \u043a\u043b\u043e\u043d\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D0%BB%D0%BB%D0%B8_(%D0%BE%D0%B2%D1%86%D0%B0)\" title=\"\u0414\u043e\u043b\u043b\u0438 (\u043e\u0432\u0446\u0430)\">\u043e\u0432\u0446\u0430 \u0414\u043e\u043b\u043b\u0438<\/a>.<\/li><\/ul><h3>XXI \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2004\" class=\"mw-redirect\" title=\"2004\">2004<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BE%D0%B0%D0%BD%D0%BD_%D0%9F%D0%B0%D0%B2%D0%B5%D0%BB_II\" title=\"\u0418\u043e\u0430\u043d\u043d \u041f\u0430\u0432\u0435\u043b II\">\u043f\u0430\u043f\u0430 \u0418\u043e\u0430\u043d\u043d \u041f\u0430\u0432\u0435\u043b II<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b \u0434\u0435\u043a\u0440\u0435\u0442 \u043e \u043a\u0430\u043d\u043e\u043d\u0438\u0437\u0430\u0446\u0438\u0438 12 \u043d\u043e\u0432\u044b\u0445 \u0441\u0432\u044f\u0442\u044b\u0445 \u041a\u0430\u0442\u043e\u043b\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0426\u0435\u0440\u043a\u0432\u0438. \u0421\u0440\u0435\u0434\u0438 \u043d\u043e\u0432\u044b\u0445 \u043a\u0430\u0442\u043e\u043b\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0441\u0432\u044f\u0442\u044b\u0445&#160;\u2014 \u0447\u0435\u0442\u0432\u0435\u0440\u043e \u0438\u0442\u0430\u043b\u044c\u044f\u043d\u0446\u0435\u0432, \u0432 \u0442\u043e\u043c \u0447\u0438\u0441\u043b\u0435 \u0414\u0430\u043d\u0438\u044d\u043b\u0435 \u041a\u043e\u043c\u0431\u043e\u043d\u0438 (1831\u20141881), \u043e\u0441\u043d\u043e\u0432\u0430\u0442\u0435\u043b\u044c \u043e\u0440\u0434\u0435\u043d\u0430 \u043c\u0438\u0441\u0441\u0438\u043e\u043d\u0435\u0440\u043e\u0432. \u0426\u0435\u0440\u0435\u043c\u043e\u043d\u0438\u044f \u0435\u0433\u043e \u043a\u0430\u043d\u043e\u043d\u0438\u0437\u0430\u0446\u0438\u0438 \u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0430 \u043d\u0430 5 \u043e\u043a\u0442\u044f\u0431\u0440\u044f \u0442\u0435\u043a\u0443\u0449\u0435\u0433\u043e \u0433\u043e\u0434\u0430. \u0415\u0449\u0451 \u043e\u0434\u043d\u0430 \u043d\u043e\u0432\u0430\u044f \u0441\u0432\u044f\u0442\u0430\u044f&#160;\u2014 \u043c\u043e\u043d\u0430\u0445\u0438\u043d\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B0%D1%87%D0%B5%D0%BB%D0%BB%D0%B8,_%D0%92%D0%B8%D1%80%D0%B4%D0%B6%D0%B8%D0%BD%D0%B8%D1%8F_%D0%A7%D0%B5%D0%BD%D1%82%D1%83%D1%80%D0%B8%D0%BE%D0%BD%D0%B5\" title=\"\u0411\u0440\u0430\u0447\u0435\u043b\u043b\u0438, \u0412\u0438\u0440\u0434\u0436\u0438\u043d\u0438\u044f \u0427\u0435\u043d\u0442\u0443\u0440\u0438\u043e\u043d\u0435\">\u0412\u0438\u0440\u0434\u0436\u0438\u043d\u0438\u044f \u0427\u0435\u043d\u0442\u0443\u0440\u0438\u043e\u043d\u0435 \u0411\u0440\u0430\u0447\u0435\u043b\u043b\u0438<\/a> (1587\u20141651), \u0434\u043e\u0447\u044c \u0432\u0435\u043d\u0435\u0446\u0438\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u0434\u043e\u0436\u0430. \u0415\u0439 \u0431\u044b\u043b\u043e \u043f\u043e\u0441\u0432\u044f\u0449\u0435\u043d\u043e \u0431\u043e\u0433\u043e\u0441\u043b\u0443\u0436\u0435\u043d\u0438\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B1%D0%BE%D1%80_%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%D0%B3%D0%BE_%D0%9F%D0%B5%D1%82%D1%80%D0%B0\" title=\"\u0421\u043e\u0431\u043e\u0440 \u0421\u0432\u044f\u0442\u043e\u0433\u043e \u041f\u0435\u0442\u0440\u0430\">\u0441\u043e\u0431\u043e\u0440\u0435 \u0441\u0432\u044f\u0442\u043e\u0433\u043e \u041f\u0435\u0442\u0440\u0430<\/a> 18 \u043c\u0430\u044f. \u0417\u0430 \u043f\u043e\u0447\u0442\u0438 \u0447\u0435\u0442\u0432\u0435\u0440\u0442\u044c \u0432\u0435\u043a\u0430 \u0441\u0432\u043e\u0435\u0433\u043e \u043f\u0440\u0435\u0431\u044b\u0432\u0430\u043d\u0438\u044f \u043d\u0430 \u043f\u0430\u043f\u0441\u043a\u043e\u043c \u043f\u0440\u0435\u0441\u0442\u043e\u043b\u0435 \u0418\u043e\u0430\u043d\u043d \u041f\u0430\u0432\u0435\u043b II \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0441\u0438\u043b 1311 \u043d\u043e\u0432\u044b\u0445 \u0431\u043b\u0430\u0436\u0435\u043d\u043d\u044b\u0445 \u0438 476 \u0441\u0432\u044f\u0442\u044b\u0445 \u041a\u0430\u0442\u043e\u043b\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0426\u0435\u0440\u043a\u0432\u0438.<\/li><\/ul><h2>"}